    }
  }


    \begin {tikzcd}
      Fc\ar [d, "F\eta _c"']\ar [r, "1_{Fc}"] & Fc\ar [d, "1_{Fc}"] \\
      FGFc\ar [r, "\epsilon _{Fc}"'] & Fc
    \end {tikzcd}


commutes. The adjoint square is 




