  \begin {tikzcd}
    F\ar [r, "F\eta "]\ar [dr, "1_F"'] & FGF\ar [d, "\epsilon  F"] \\
    & F
  \end {tikzcd}
  \quad  and \quad 
  \begin {tikzcd}
    G\ar [r, "\eta  G"]\ar [dr, "1_G"'] & GFG\ar [d, "G\epsilon "] \\
     & G\makebox [0pt][l]{.}
  \end {tikzcd}

